.recommand .recommand_box .rec_img {
  position: relative;
  width: 33.3333%;
  margin-right: 20px;
}

.recommand .recommand_box .rec_img img {
  width: 100%;
  height: 750px;
}

.recommand .recommand_box .rec_img:last-child {
  margin-right: 0;
}

.recommand .recommand_box .rec_plus {
  position: absolute;
}

.recommand .recommand_box .plus {
  top: 350px;
  left: calc(50% - 90px);
}

.recommand .recommand_box .plus1 {
  bottom: 150px;
  right: calc(50% - 110px);
}

.recommand .recommand_box .rec_plus span {
  border: 1px solid #ccc;
  background-color: #fff;
  border-radius: 50%;
  padding: 5px;
  cursor: pointer;
}

.recommand .recommand_box .rec_plus .rec_desc {
  position: absolute;
  background-color: #ccc;
  width: 180px;
  height: 50px;
  margin-top: 5px;
  padding: 0 5px;
}

/************sns*************/
.sns h1 {
  text-align: center;
}

.sns .sns_box {
  padding: 30px 0;
}

.sns .sns_box .sns_list {
  width: 100%;
  padding: 0 50px;
  display: flex;
  flex-wrap: wrap;
}

.sns .sns_box .sns_list li {
  width: calc(20% - 12px);
  margin-right: 15px;
  margin-bottom: 20px;
}

.sns .sns_box .sns_list li:nth-child(5n) {
  margin-right: 0;
}

.sns .sns_box .sns_list li img {
  width: 100%;
  height: 320px;
  background-position: 50% 50%;
  background-size: cover;
  background-repeat: no-repeat;
}


/***********footer************/
.footer {
  width: 100%;
  margin-top: 100px;
  padding: 50px;
  background-color: rgb(238, 238, 238);
}

.footer .footer_nav {
  display: flex;
  justify-content: space-between;
  margin-bottom: 40px;
}

.footer .footer_nav ul {
  width: 20%;
}

.footer .footer_nav ul li.f_nav_tit {
  font-size: 28px;
  font-weight: 700;
  margin-bottom: 15px;
  letter-spacing: 1px;
}

.footer .footer_nav ul.footer_top li img {
  width: 150px;
}

.footer .footer_nav ul.footer_top li:nth-child(2) {
  width: 40%;
  padding-top: 90px;
}

.footer .footer_nav ul li {
  text-align: center;
  line-height: 40px;
  font-size: 16px;
}

.footer .footer_nav ul li a {
  color: black;
}

.footer .footer_list {
  margin-bottom: 40px;
}

.footer .footer_list ul {
  display: flex;
  flex-wrap: wrap;
}

.footer .footer_list ul li {
  width: 20%;
  line-height: 50px;
  text-align: center;
}

.footer .footer_list ul li a {
  font-size: 16px;
  color: #000;
  font-weight: 700;
}

.footer .footer_list ul li select {
  border: none;
  background: none;
  font-size: 16px;
  font-weight: 700;
  outline: none;
  margin-left: 25px;
}

.footer .footer_list ul li a.red {
  color: red;
}

.footer .footer_list ul li a.blue {
  color: blue;
}

.footer .footer_bottom {
  display: flex;
  justify-content: space-between;
}

.footer .footer_bottom p {
  color: #777;
  letter-spacing: 1px;
}

.footer .footer_bottom .f_bom_right p a {
  display: block;
  font-size: 22px;
  color: #000;
  text-align: center;
  border: 1px solid black;
  border-radius: 25px;
  padding: 5px 40px;
  font-weight: 700;
  margin-bottom: 20px;
  transition: all 0.3s;
}

.footer .footer_bottom .f_bom_right p a:hover {
  color: #fff;
  background-color: #002053;
}

.footer .footer_bottom .f_bom_right p.bold {
  color: #000;
  font-weight: 700;
  font-size: 18px;
}

.footer .footer_bottom .f_sns {
  padding-right: 30px;
}

.footer .footer_bottom .f_sns ul {
  display: flex;
}

.footer .footer_bottom .f_sns li a {
  display: block;
  width: 52px;
  height: 50px;
  font-size: 0;
  background-repeat: no-repeat;
  background-position: center center;
}

.footer .footer_bottom .f_sns li a.insta {
  background-image: url(/249d12a782ae98300663d3e2f8b12c59.svg);
}

.footer .footer_bottom .f_sns li a.facebook {
  background-image: url(/25a602c942259e043c4fcbb7ff7aa334.svg);
}

.footer .footer_bottom .f_sns li a.youtube {
  background-image: url(/ca2c242b35407cf45378e7ee58f7604e.svg);
}

.footer .footer_bottom .f_sns li a.kakao {
  background-image: url(/38cd9e7c4ac41827ac1e6342e942f459.svg);
}

/*************quick_menu***********/
.quick {
  position: absolute;
  right: 0px;
  width: 85px;
  height: 224px;
  transition: .3s;
  overflow: hidden;
}

.quick .quick_box {
  display: flex;
  width: 100%;
  align-items: center;
  position: absolute;
  right: 0px;
  top: 0;
  transition: all 0.3s;
  background-color: #fff;
  border: 1px solid black;
  padding: 5px;
  z-index: 9999;
  overflow: hidden;
}

.quick:hover {
  width: 220px;
}

.quick .quick_box:hover {
  right: 0;
}

.quick .quick_box .quick_menu a {
  width: 130px;
  display: block;
  color: #000;
  font-weight: 700;
  font-size: 18px;
  transition: .3s;
}

.quick .quick_box ul li:hover a {
  color: red;
}

.quick .quick_nav li {
  margin: 0 15px;
}

.quick .quick_nav li a.bg {
  width: 50px;
  height: 50px;
  font-size: 0;
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center center;
}

.quick ul li a {
  display: block;
  line-height: 53px;
}

.quick .quick_nav li a.profile {
  background-image: url(/d9289382961f2aa5bf453c2be99ad2dd.svg);
}

.quick .quick_nav li a.service {
  background-image: url(/ee3567d4a9e7ce221f7d06b32c162fc3.png);
}

.quick .quick_nav li a.order {
  background-image: url(/2a2c3464f529f595e63b7e70bc580ead.png);
}

.quick .quick_nav li a.recent {
  background-image: url(/d827d4a59ef0c0f5dfda3f5a79195525.png);
}

.arrow {
  position: fixed;
  display: flex;
  flex-direction: column;
  bottom: 30px;
  right: 40px;
  padding-top: 10px;
  z-index: 2;
}

.arrow a {
  color: #000;
  font-size: 40px;
  border: 1px solid #ccc;
  line-height: 40px;
  background-color: #fff;
  padding: 0 10px;
  margin-bottom: 10px;
}

.arrow a:hover {
  background-color: #002053;
  color: #fff;
}

.arrow a:last-child {
  margin-bottom: 0;
}

