@import url('https://fonts.googleapis.com/css2?family=Nanum+Gothic:wght@400;700&family=Noto+Sans+KR:wght@100;300;400;500;700&display=swap');

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  font-size: 14px;
  font-family: '노토산스', 'Noto Sans KR', '나눔고딕', 'Nanum Gothic', '돋움', 'Dotum', '굴림', 'Gulim', sans-serif;
}

li {
  list-style: none;
}

a {
  text-decoration: none;
}

img {
  display: block;
}

h1 {
  font-size: 40px;
}

.container {
  width: 1610px;
  margin: 0 auto;
}

.down_tit {
  font-size: 20px;
  font-weight: 700;
  color: #000;
}


/*************scroll header**************/
.scroll.scr_up .header {
  visibility: hidden;
  transform: translateY(-100%);
  transition: all 0.3s;
}

.scroll.scr_down .header {
  visibility: visible;
  transform: translateY(0%);
  background-color: #fff;
  opacity: 1;
  transition: all 0.3s;
  box-shadow: 0px 0px 2px #ccc;
}

.scroll.scr_up.search_on .header {
  transform: translateY(0%);
  opacity: 1;
  visibility: visible;
}

.scroll.scr_down .header .logo a,
.scroll.bg_on .header:hover .logo a,
.scroll.search_on .header .logo a {
  background-image: url(../img/Logo/blue_fila.png);
  background-size: contain;
}

.scroll.bg_on .header .down {
  display: flex;
  opacity: 1;
}

.scroll.bg_on .header .blur {
  display: block;
}

.scroll.bg_on .header:hover,
.scroll.bg_on .header .down {
  background-color: #fff;
}

.scroll.bg_on .header div.bar,
.scroll.scr_down .header div.bar,
.scroll.search_on .header div.bar {
  background-color: #000;
}

.scroll.bg_on.scr_up .header {
  visibility: visible;
  opacity: 1;
}

/* .scroll.bg_on.scr_up .header>ul>li .down {
  visibility: visible;
} */

.scroll.scr_down .header>div a,
.scroll.scr_down .header>div i,
.scroll.bg_on .header>div a,
.scroll.bg_on .header>div i,
.scroll.search_on .header>div a,
.scroll.search_on .header>div i {
  color: #000;
}

.scroll.search_on .header {
  background-color: #fff;
}

.scroll.search_on .header .search_down {
  opacity: 1;
  visibility: visible;
}

/***************header********************/
.header {
  position: fixed;
  width: 100%;
  height: 90px;
  top: 0;
  left: 0;
  display: flex;
  justify-content: space-between;
  align-items: center;
  transition: all 0.1s;
  background: none;
  z-index: 9999;
}

.header .blur {
  display: none;
  position: absolute;
  top: 90px;
  left: 0;
  width: 100%;
  height: 130vh;
  backdrop-filter: blur(20px);
  z-index: -1;
}

.header .logo {
  width: 18%;
  margin-left: 60px;
}

.header .logo a {
  display: block;
  width: 120px;
  height: 45px;
  background: url(../img/Logo/white_fila.png) no-repeat center;
  background-size: contain;
}

.lnb {
  display: flex;
  margin-right: 80px;
}

.lnb .bar {
  width: 1px;
  height: 12px;
  background-color: #fff;
  margin: 0 20px;
}

.lnb .lnb_nav {
  display: flex;
  align-items: center;
  overflow: hidden;
}

.lnb .lnb_nav>li {
  margin-top: 20px;
  padding-bottom: 20px;
}

.lnb .lnb_nav>li>a {
  position: relative;
  display: block;
  color: #fff;
  font-size: 18px;
  font-weight: 700;
  padding: 15px;
  letter-spacing: 1px;
}

.lnb .lnb_nav>li>a::before {
  left: 50%;
}

.lnb .lnb_nav>li>a::after {
  right: 50%;
}

.lnb .lnb_nav>li>a::before,
.lnb .lnb_nav>li>a::after {
  content: '';
  position: absolute;
  top: 43px;
  display: block;
  width: 0;
  height: 2px;
  background-color: #000;
  transition: all 0.2s;
}

.lnb .lnb_nav>li:hover>a::before,
.lnb .lnb_nav>li:hover>a::after {
  width: 40px;
}

.lnb .lnb_nav>li:nth-child(2):hover>a::before,
.lnb .lnb_nav>li:nth-child(2):hover>a::after,
.lnb .lnb_nav>li:nth-child(3):hover>a::before,
.lnb .lnb_nav>li:nth-child(3):hover>a::after {
  width: 25px;
}

.gnb {
  display: flex;
  align-items: center;
  margin-right: 25px;
}

.gnb li {
  width: 60px;
}

.gnb li a {
  display: block;
  text-align: center;
  padding: 15px;
}

.gnb li a i {
  font-size: 25px;
  color: #fff;
}

.gnb li a i.material-symbols-outlined {
  font-size: 30px;
}

.gnb li a i.bag {
  font-size: 30px;
  line-height: 1.1;
}

/**************header_down_menu*************/
.header .lnb .down {
  visibility: hidden;
  position: absolute;
  display: none;
  justify-content: center;
  z-index: 9999;
  top: 90px;
  left: 0;
  width: 100%;
  background-color: #fff;
  padding: 20px 40px 60px;
  opacity: 0;
}

.header .lnb li:nth-child(1):hover .women_down,
.header .lnb li:nth-child(2):hover .men_down,
.header .lnb li:nth-child(3):hover .kids_down,
.header .lnb li.brand:hover .brand_down {
  visibility: visible;
  opacity: 1;
  display: flex;
}

.header .category_menu ul>li>a {
  color: #000;
}

.header .down ul li a {
  font-size: 16px;
  line-height: 32px;
}

.header .lnb .down .inner {
  display: flex;
  justify-content: center;
  width: 1540px;
  margin: 0 auto;
}

.header .category_menu {
  width: 100%;
  display: flex;
  justify-content: space-between;
}

.header .category_menu ul {
  margin-top: 20px;
}

.header .category_menu ul li a {
  transition: all 0.2s;
}

.header .category_menu ul li a:hover {
  color: blue;
}

.header .category_menu>div {
  width: 20%;
  padding-left: 30px;
  border-right: 1px solid #ccc;
}

.header .category_menu>div:last-child {
  border: none;
}

.header .kids_down .category_menu {
  justify-content: center;
}

.header .kids_down .category_menu div {
  flex-basis: 290px;
}

.header .brand_down .brand_menu {
  display: flex;
}

.header .brand_down .brand_menu li {
  margin-left: 20px;
}

.header .brand_down .brand_menu li:first-child {
  margin-left: 0;
}

.header .brand_down .brand_menu li a {
  display: block;
}

.header .brand_down .brand_menu li a .brand_img {
  overflow: hidden;
}

.header .brand_down .brand_menu img {
  width: 100%;
  height: 370px;
  transition: all 0.4s;
}

.header .brand_down .brand_menu li a .brand_img:hover img {
  transform: scale(1.1);
}

.header .brand_down .brand_menu li a p {
  text-align: center;
  color: #000;
  padding-top: 10px;
  font-weight: 700;
  font-size: 16px;
}

.header .search_down {
  visibility: hidden;
  position: absolute;
  width: 100%;
  top: 90px;
  left: 0;
  opacity: 0;
  padding-top: 10px;
  background-color: #fff;
  transition: all 0.1s;
}

.header .search_down .container {
  width: 1440px;
  margin: 0 auto;
}

.header .search_down .input_box {
  display: flex;
  align-items: center;
  margin: 10px 0;
  padding: 0 20px;
  border-radius: 30px;
  background-color: rgb(238, 238, 238);
}

.header .search_down .input_box .search_btn {
  display: block;
  background-image: url(../img/search.svg);
  background-repeat: no-repeat;
  background-position: center center;
  width: 60px;
  height: 60px;
  font-size: 0;
  border: none;
}

.header .search_down .input_box input {
  width: calc(100% - 60px);
  height: 60px;
  outline: none;
  border: none;
  font-size: 24px;
  font-weight: 700;
  text-align: center;
  color: #000;
  background: none;
}

.header .search_down .input_box input::placeholder {
  text-align: center;
}

.header .search_down .search_close {
  position: absolute;
  width: 50px;
  height: 50px;
  top: 15px;
  right: 50px;
  border: 0;
  background: none;
  font-size: 35px;
  cursor: pointer;
}

.word_tit {
  font-size: 20px;
  font-weight: 700;
  margin-bottom: 15px;
}

.header .search_down .search_word {
  display: flex;
  justify-content: space-between;
  margin-top: 20px;
  padding: 10px 20px 40px 20px;
}

.header .search_down .search_word ul {
  width: 25%;
}

.header .search_down .search_word li a {
  color: #000;
  font-size: 16px;
  line-height: 32px;
}

.header .search_down .search_word ul:nth-child(3) {
  margin-right: 30px;
}

.header .search_blur {
  position: absolute;
  top: 0;
  width: 100%;
  height: 100vh;
  z-index: -1;
  backdrop-filter: blur(20px);
}

/*************visual_main*****************/
.swiper {
  position: relative;
  width: 100%;
  height: 100vh;
}

.swiper .swiper-wrapper .swiper-slide-active {
  width: 100%;
}

.myswiper .swiper-slide-active img {
  width: 100%;
  height: 100%;
}

.swiper .swiper-slide img {
  width: 100%;
  height: 100%;
}

.swiper>.swiper-wrap>.swiper-pagination-progressbar,
.swiper-pagination-progressbar.swiper-pagination-horizontal {
  width: 350px;
  top: auto;
  left: 30px;
  z-index: 2;
  height: var(--swiper-pagination-progressbar-size, 20px);
  background-color: #fff;
}

.swiper .swiper-pagination {
  color: #fff;
  bottom: -25px;
  left: 25px;
}

.swiper .swiper-pagination-progressbar .swiper-pagination-progressbar-fill {
  background-color: #002053;
}

.swiper-wrap {
  position: absolute;
  display: flex;
  left: 110px;
  bottom: 120px;
  width: 400px;
}

.swiper-pagination {
  visibility: hidden;
  font-size: 25px;
  font-weight: bold;
}

.swiper-pagination-current,
.swiper-pagination-total {
  visibility: visible;
  position: absolute;
  left: -20px;
}

.swiper-pagination-total {
  left: auto;
  right: 20px;
}

.visual_arrow .swiper-button-prev,
.visual_arrow .swiper-button-next {
  width: 50px;
  height: 60px;
  color: #fff;
  transform: translateY(-50%);
  top: 50%;
  left: 100px;
  text-align: center;
  z-index: 1;
}

.visual_arrow .swiper-button-next {
  left: auto;
  right: 100px;
  z-index: 1;
}

.visual_arrow .swiper-button-prev::after,
.visual_arrow .swiper-button-next::after {
  font-size: 50px;
}

.visual_tit {
  position: absolute;
  left: 120px;
  bottom: 150px;
  color: #fff;
}

.visual_tit .tit {
  font-weight: bold;
  font-size: 50px;
}

.visual_tit .tit_btn {
  display: inline-block;
  margin-top: 25px;
}

.visual_tit .tit_btn a {
  display: block;
  padding: 10px 40px;
  border-radius: 20px;
  border: 2px solid white;
  transition: all 0.1s;
  letter-spacing: 1px;
  color: #fff;
}

.visual_tit .tit_btn a:hover {
  color: #000;
  background-color: #fff;
}


/***************rank***************/
.rank {
  margin-top: 150px;
}

.rank h1 {
  font-size: 40px;
  text-align: center;
}

.rank .rank_category {
  margin: 25px 0;
}

.rank .category_btn {
  display: flex;
  justify-content: center;
  align-items: center;
}

.rank .rank_category .category_btn li {
  text-align: center;
}

.rank .rank_category .category_btn li a {
  position: relative;
  display: block;
  padding: 0 30px;
  font-size: 18px;
  line-height: 30px;
  font-weight: 400;
  color: rgb(102, 102, 102);
  letter-spacing: 1px;
  transition: all 0.2s;
}

.rank .rank_category .category_btn li a::after {
  right: 50%;
}

.rank .rank_category .category_btn li a::before,
.rank .rank_category .category_btn li a::after {
  content: '';
  display: block;
  position: absolute;
  left: 20px;
  top: 0px;
  width: 0;
  height: 100%;
  transition: all 0.2s;
  background: linear-gradient(to top, #6fa6e8 90%, transparent 45%);
  opacity: 0.8;
  z-index: -1;
}

.rank .rank_category .category_btn li:hover a::before {
  width: 80%;
}

.rank .rank_category .category_btn li:hover a {
  color: #000;
}

.rank_box {
  position: relative;
  display: flex;
  justify-content: space-between;
  margin: 50px 50px 0 50px;
}

.rank_order {
  position: absolute;
  top: 35px;
  left: 30px;
  z-index: 2;
  width: 26%;
  flex-shrink: 1;
  margin-right: 30px;
}

.rank .rank_top {
  border-bottom: 2px solid #777;
}

.rank .rank_top h3 {
  font-size: 34px;
  padding-bottom: 10px;
}

.rank .rank_bottom {
  margin-top: 10px;
}

.rank_order .rank_bottom ul li.active {
  box-shadow: 0px 0px 8px black;
}

.rank_order .rank_bottom ul li.active a {
  color: #002053;
  font-weight: 700;
  font-size: 21px;
}

.rank .rank_bottom ul li {
  border-bottom: 1px solid #000;
}

.rank .rank_bottom ul li a {
  display: block;
  padding: 5px;
  line-height: 70px;
  font-size: 18px;
  font-weight: 400;
  color: rgb(102, 102, 102);
}

.rank .rank_bottom ul li a span {
  padding: 0 15px;
}

.rankSwiper {
  position: relative;
  width: 100%;
  overflow: hidden;
}

.rankSwiper .rank_img {
  position: relative;
  overflow: hidden;
}

.rankSwiper .rank_img .rank_desc {
  position: absolute;
  width: 100%;
  bottom: 0;
  transform: translateY(100%);
  transition: all 0.3s;
  background-color: rgba(0, 0, 0, 0.3);
}

.rankSwiper .rank_img:hover .rank_desc {
  transform: translateY(0%);
}

.rankSwiper .rank_img .rank_desc ul {
  display: flex;
  align-items: center;
}

.rankSwiper .rank_img .rank_desc ul li {
  width: 60%;
  height: 100px;
  padding: 10px 25px;
}

.rankSwiper .rank_img .rank_desc ul li:nth-child(2) {
